import{_ as e,o as n,c as a,d as i}from"./index.cbe759bc.js";import"https://unpkg.com/@lottiefiles/lottie-player@latest/dist/lottie-player.js";const s="/assets/13-1.5f6c00f2.jpg",r={name:"DayThirteen.vue"},d={class:"container"},h=i('<img src="'+s+'" alt="" style="width:100%;"><div><hr><h2>13. Dezember 2022</h2><hr></div><div><br><p> Salzburg \u{1F9C2}\u{1F3F0} - Teil IV </p><br><p>Die Abk\xFChlung am See war anfangs sehr speziell \u{1F92A}</p><br><p>Kein Platz bzw der Bereich viel kleiner als gedacht, f\xFCr diese Uhrzeit zu viele Leute, keine freien Liegen mehr.....doch ein P\xE4rchen hat sich dann gaaaaaaaaaaanz laaaaaaaaangsam zusammengepackt - die haben gesehen, dass wir gewartet haben, und dann haben sie sich noch mehr Zeit gelassen, herrlich. \u{1F606} </p><br><p>Und da war noch diese freie Liege - schnell sind wir hin und dann haben wir bemerkt, dass die doch nicht so frei ist - die (nicht)nette Dame aus Tschechien hat nur wild gestikuliert und du hast trotzdem lieb auf die Liege gezeigt. \u{1F60D} Aber dann war das P\xE4rchen auch schon fertig und dann haben wir endlich unseren Platz gefunden.</p><br><p>Kannst du dich noch an das tanzende Kind erinnern? Das so gef\xE4hrlich auf einer Mauer stand? \u{1F92F}</p><br><p>Dann ging es endlich in das Wasser, zumindest dachte ich das, denn dann habe ich Steg zum Wasser gesehen - ein Wunder, dass sich keiner das Genick gebrochen hat. \u{1F92C} Und dann waren wir endlich im Wasser - und es war sooooo kalt. \u{1F976}</p><br><p>Genau aus diesem Grund mussten ich dich dann auch schnappen und dich an mich dr\xFCcken. \u{1F62C} Und dann waren wir auch ein wenig unartig...oder? Mehr dazu morgen, morgen wirds dann \u{1F525}\u{1F525}\u{1F525}</p></div>',3),t=[h];function c(o,u,l,g,p,m){return n(),a("div",d,t)}const w=e(r,[["render",c]]);export{w as default};
